import React, { useEffect, useState } from "react";
import {deleteProductListing} from "../../Services/ProductListingService.js";
export default function ProductListingsListItem(props){

    const [productListing, deleteListing] = useState([]);

    useEffect(() => {
        deleteListing().then((productListings) => {
          setListings(productListings);
        });
      }, []);
    return (
        <span>
            {props.SellerName}
            &nbsp;<button>Delete this listing</button>
        </span>
    )
}
